-- Table structure for table `migrate_field_mapping`
--

DROP TABLE IF EXISTS `migrate_field_mapping`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `migrate_field_mapping` (
  `fmid` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Unique ID for the field mapping row',
  `machine_name` varchar(255) NOT NULL COMMENT 'Parent migration for the field mapping',
  `destination_field` varchar(255) NOT NULL COMMENT 'Destination field for the field mapping',
  `source_field` varchar(255) NOT NULL COMMENT 'Source field for the field mapping',
  `options` longblob COMMENT 'A serialized MigrateFieldMapping object holding all options',
  PRIMARY KEY (`fmid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='History of migration processes';
